// LLMNode.jsx - Refactored to use BaseNode

import { BaseNode } from './BaseNode';
import { nodeConfig } from '../../config/nodeConfig';

const config = nodeConfig.llm;

export const LLMNode = ({ id, data, selected }) => {
  return (
    <BaseNode
      id={id}
      title={config.title}
      icon={config.icon}
      category={config.category}
      inputs={config.defaultInputs}
      outputs={config.defaultOutputs}
      selected={selected}
    >
      <p className="text-xs text-muted-foreground">
        Large Language Model for text generation. Connect system prompt and user prompt inputs.
      </p>
    </BaseNode>
  );
};

export default LLMNode;
